function Launch() {
    // CSS
    const elm_style = document.createElement("style");
    elm_style.innerHTML = `
                    :root{
                        --img0: url('data:image/jpeg;base64,');
						--img1: url('data:image/jpeg;base64,')}
                    #genshinLaunch {
                        display: block;
                        position: fixed;
                        width: 100vw;
                        height: 100vh;
                        top: 0;
                        left: 0;
                        z-index: 1000000000;
                        background-size: contain;
                        background-position: center;
                        background-repeat: no-repeat;
                        background-color: #fff;
                        animation-name: launch;
                        animation-duration: 10s;
                        animation-fill-mode: forwards;
                    }
                    @keyframes launch {
                        0% {
                            background-image: var(--img0);
                        }
                        20% {
                            background-image: var(--img0);
                        }
                        40% {
                            background-image: var(--img1);
                        }
                        70% {
                            background-image: var(--img1);
                        }
                        100% {
                            background-image: var(--img1);
                        }
                    }
        `;
    document.head.appendChild(elm_style);

    // 启动音效
    const elm_audio = document.createElement("audio");
    elm_audio.style.display = "none";
    elm_audio.loop = true;
    elm_audio.src = "data:audio/mpeg;base64,";
    elm_audio.play();
    const elm_audio_2 = document.createElement("audio");
    elm_audio_2.style.display = "none";
    elm_audio_2.loop = false;
    elm_audio_2.src = "./mw.mp3"
    elm_audio_2.play();
    // 启动画面
    const elm_div = document.createElement("div");
    elm_div.id = "genshinLaunch";
    document.body.appendChild(elm_div);

    // 起洞！
    setTimeout(() => {
        window.location.href = 'http://mw.netfox.wiki/zh/intl/mw/';
        elm_div.onclick = () => {
            elm_audio.pause();
            elm_div.remove();
            elm_style.remove();
        }
    }, 8000)
}

console.log("%c 现代战舰，启动！ %c https://mw.netfox.wiki By MW-MWT-DOCS & NetFox.Wiki", "color: #fff; margin: 1em 0; padding: 5px 0; background: #74759b;", "margin: 1em 0; padding: 5px 0; background: #e7a23f;");